import React from 'react';
import { Switch, Route} from 'react-router-dom';

import Navbar from './component/Navbar';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar />

          <Switch>
            <Route path='/' exact/>
          </Switch>

      </Router>
    </>
  );
}

export default App;
